🌙✨ PM perfection with Axis-Y’s Dark Spot Brightening lineup! 🌿

@axisy_official sent over some of their products to try and I’ve had a chance to play with them for over two months now! Here are the thee products that have made the cut into my routine for brighter, smoother mornings: 

💧Dark Spot Correcting Glow Serum: Powered by Niacinamide to brighten and fade dark spots effortlessly.
🌱Dark Spot Correcting Cream: Lightweight yet hydrating, the niacinamide, arbutin and peptides complex, provide moisture while evening out skin tone.
👁️Collagen Boosting Eye Serum: This silky and soothing serum plumps the delicate under-eye area while the cooling applicator depuffs! This one makes an appearance even in my AM routine🥰

The products are all super lightweight and particularly well suited for layering. I absolutely love the textures and am excited to see the difference they make to my skin long term✨ 

